      <textColor reference="8"/>
      <text id="9" justification="0" size="4" underlined="false">
        <text>From specification:
The elevator subsystem responds to the scheduler to control the motor and to
open the doors.
/
 The elevator subsystem also has to monitor the floor subsystem for destination requests
(button presses inside of the elevator car, rather than button presses at the floors) from the input file. 
/
Button presses are to be rerouted to the scheduler system. Lamp (floor indications) from button pushes do not have
to originate from the scheduler. Rather, when the elevator subsystem detects a button request, it can then light
the corresponding lamp. When the elevator reaches a floor, the scheduling subsystem signals the elevator
subsystem to turn the lamp off. </text>
      </text>
